INSERT INTO `tbljob` VALUES (1,'Nhà Phát Triển/Kỹ Sư Phần Mềm\n','Software Developer/Engineer','Thành thạo các ngôn ngữ lập trình (ví dụ: Java, C++, Python), hiểu biết về vòng đời phát triển phần mềm (SDLC), kinh nghiệm với các hệ thống kiểm soát phiên bản (ví dụ: Git), kỹ năng giải quyết vấn đề và chú ý đến chi tiết là rất cần thiết. Ngoài ra, khả năng viết mã sạch, có thể mở rộng và dễ bảo trì cùng với sự quen thuộc với các phương pháp Agile cũng rất quan trọng.\n','Proficiency in programming languages (e.g., Java, C++, Python). Understanding of software development life cycle (SDLC). Experience with version control systems (e.g., Git). Problem-solving skills and attention to detail. Ability to write clean, scalable, and maintainable code. Familiarity with Agile methodologies.',NULL,'java, python, nosql','Thiết kế, phát triển, thử nghiệm và bảo trì các ứng dụng phần mềm.','Designs, develops, tests, and maintains software applications.','2024-04-03 21:45:07','2024-04-03 21:45:07',_binary '\0',NULL,NULL,NULL,NULL,NULL,NULL,NULL,'job1.webp'),(2,'Chuyên Viên Phân Tích Hệ Thống\n','Systems Analyst','Kỹ năng phân tích và giải quyết vấn đề mạnh mẽ, thành thạo các công cụ và kỹ thuật phân tích hệ thống, kinh nghiệm với quản lý cơ sở dữ liệu và SQL, khả năng hiểu và mô hình hóa các quy trình kinh doanh, kỹ năng giao tiếp và lập tài liệu xuất sắc, cùng với kiến thức về công nghệ phần mềm và phần cứng là rất cần thiết.\n','Strong analytical and problem-solving skills.\nProficiency with system analysis tools and techniques.\nExperience with database management and SQL.\nAbility to understand and model business processes.\nExcellent communication and documentation skills.\nKnowledge of software and hardware technologies.',NULL,'SQL, UML','Phân tích và thiết kế hệ thống thông tin để đáp ứng nhu cầu kinh doanh.','Analyzes and designs information systems to meet business needs.','2024-04-03 21:45:07','2024-04-03 21:45:07',_binary '\0',NULL,NULL,NULL,NULL,NULL,NULL,NULL,'job2.jpg'),(3,'Quản Trị Mạng/Kỹ Sư Mạng','Network Administrator/Engineer','Kiến thức chuyên sâu về các giao thức mạng (ví dụ: TCP/IP, DNS, DHCP), kinh nghiệm với phần cứng mạng (ví dụ: bộ định tuyến, switch), quen thuộc với các biện pháp bảo mật mạng, khả năng khắc phục sự cố mạng, các chứng chỉ như Cisco\n','In-depth knowledge of network protocols (e.g., TCP/IP, DNS, DHCP).\nExperience with network hardware (e.g., routers, switches).\nFamiliarity with network security practices.\nAbility to troubleshoot network issues.\nCertifications like Cisco CCNA/CCNP can be advantageous.\nKnowledge of network monitoring tools.',NULL,'Java, C++, Git','Quản lý và duy trì mạng máy tính của một tổ chức.','Manages and maintains an organization\'s computer networks.','2024-04-03 21:45:07','2024-04-03 21:45:07',_binary '\0',NULL,NULL,NULL,NULL,NULL,NULL,NULL,'job3.png'),(4,'Quản Trị Cơ Sở Dữ Liệu (DBA)\n','Database Administrator (DBA)','Thành thạo với các hệ thống quản lý cơ sở dữ liệu (ví dụ: Oracle, MySQL, SQL Server). Kiến thức về bảo mật cơ sở dữ liệu, sao lưu và phục hồi. Kinh nghiệm với SQL và các kỹ thuật tối ưu hóa cơ sở dữ liệu. Khả năng giám sát và duy trì hiệu suất cơ sở dữ liệu. Kỹ năng\n','Proficiency with database management systems (e.g., Oracle, MySQL, SQL Server). Knowledge of database security, backup, and recovery. Experience with SQL and database optimization techniques. Ability to monitor and maintain database performance. Strong problem-solving skills. Understanding of data modeling and database design.',NULL,'Network','Quản lý và duy trì cơ sở dữ liệu, đảm bảo tính toàn vẹn và bảo mật dữ liệu.','Manages and maintains databases, ensuring data integrity and security.','2024-04-03 21:45:07','2024-04-03 21:45:07',_binary '\0',NULL,NULL,NULL,NULL,NULL,NULL,NULL,'job4.jpg'),(5,'Quản Lý Dự Án CNTT\n','IT Project Manager','Kỹ năng lãnh đạo và quản lý đội nhóm mạnh mẽ. Thành thạo với phần mềm quản lý dự án (ví dụ: MS Project, JIRA). Kinh nghiệm với các phương pháp Agile và Scrum. Kỹ năng giao tiếp và tổ chức xuất sắc. Khả năng quản lý ngân sách và tiến độ. Chứng chỉ PMP hoặc tương tự thường được ưu tiên. Chuyên gia An ninh CNTT.\n','Strong leadership and team management skills.\nProficiency with project management software (e.g., MS Project, JIRA).\nExperience with Agile and Scrum methodologies.\nExcellent communication and organizational skills.\nAbility to manage budgets and timelines.\nPMP or similar certification is often preferred.\nIT Security Specialist.',NULL,'Agile&Scrum, Jira','Lập kế hoạch, thực hiện và giám sát các dự án CNTT, đảm bảo chúng được hoàn thành đúng thời hạn và trong ngân sách.','Plans, executes, and oversees IT projects, ensuring they are completed on time and within budget.','2024-04-03 21:45:07','2024-04-03 21:45:07',_binary '\0',NULL,NULL,NULL,NULL,NULL,NULL,NULL,'job5.jpg'),(6,'Chuyên Viên An Ninh CNTT\n','IT Security Specialist','Kiến thức về các giao thức và thực hành bảo mật (ví dụ: tường lửa, mã hóa), kinh nghiệm với các công cụ bảo mật (ví dụ: IDS/IPS, SIEM), hiểu biết về tuân thủ quy định (ví dụ: GDPR, HIPAA), kỹ năng phân tích mạnh mẽ và giải quyết vấn đề, các chứng chỉ như CISSP, CEH hoặc CISM có thể là một lợi thế, khả năng phát triển và triển khai chính sách bảo mật là rất cần thiết.\n','Knowledge of security protocols and practices (e.g., firewalls, encryption).\nExperience with security tools (e.g., IDS/IPS, SIEM).\nUnderstanding of regulatory compliance (e.g., GDPR, HIPAA).\nStrong analytical and problem-solving skills.\nCertifications like CISSP, CEH, or CISM are advantageous.\nAbility to develop and implement security policies.',NULL,'Firewalls, encryption, IDS/IPS','Tập trung vào việc bảo vệ hệ thống máy tính và mạng của tổ chức khỏi các vi phạm an ninh.','Focuses on safeguarding an organization\'s computer systems and networks from security breaches.','2024-04-03 21:45:07','2024-04-03 21:45:07',_binary '\0',NULL,NULL,NULL,NULL,NULL,NULL,NULL,'job6.jpg'),(7,'Nhà Phát Triển/Thiết Kế Web\n','Web Developer/Designer','Thành thạo HTML, CSS, JavaScript và các framework (ví dụ: React, Angular), kinh nghiệm với các ngôn ngữ server-side (ví dụ: PHP, Node.js), hiểu biết sâu về nguyên lý UI/UX, khả năng tạo ra thiết kế responsive và thân thiện với người dùng, quen thuộc với các công cụ phát triển web và hệ thống kiểm soát phiên bản, kiến thức về các phương pháp tối ưu hóa SEO.\n','Proficiency in HTML, CSS, JavaScript, and frameworks (e.g., React, Angular).\nExperience with server-side languages (e.g., PHP, Node.js).\nStrong understanding of UI/UX principles.\nAbility to create responsive and user-friendly designs.\nFamiliarity with web development tools and version control systems.\nKnowledge of SEO best practices.',NULL,'React, Angular, SEO, Node.js','Tạo và thiết kế các trang web, ứng dụng web và giao diện người dùng.','Creates and designs websites, web applications, and user interfaces.','2024-04-03 21:45:07','2024-04-03 21:45:07',_binary '\0',NULL,NULL,NULL,NULL,NULL,NULL,NULL,'job7.jpg'),(8,'Quản Trị Hệ Thống\n','Systems Administrator','Kinh nghiệm với các hệ điều hành (ví dụ: Windows, Linux, Unix). Kiến thức về bảo mật hệ thống và các thực hành sao lưu/phục hồi. Khả năng xử lý sự cố phần cứng và phần mềm. Thành thạo với các công cụ giám sát và quản lý hệ thống. Kỹ năng giải quyết vấn đề mạnh mẽ. Quen thuộc với các công nghệ ảo hóa (ví dụ: VMware, Hyper-V).\n','Experience with operating systems (e.g., Windows, Linux, Unix).\nKnowledge of system security and backup/recovery practices.\nAbility to troubleshoot hardware and software issues.\nProficiency with system monitoring and management tools.\nStrong problem-solving skills.\nFamiliarity with virtualization technologies (e.g., VMware, Hyper-V).',NULL,'Linux, Unix, VNware, Hyper-V','Quản lý và bảo trì hệ thống máy tính của tổ chức, bao gồm phần cứng và phần mềm.','Manages and maintains an organization\'s computer systems, including hardware and software.','2024-04-03 21:45:07','2024-04-03 21:45:07',_binary '\0',NULL,NULL,NULL,NULL,NULL,NULL,NULL,'job8.jpg'),(9,'Chuyên Viên Phân Tích Kinh Doanh Thông Minh (BI)','Business Intelligence (BI) Analyst','Thành thạo với các công cụ BI (ví dụ: Power BI, Tableau). Kỹ năng phân tích mạnh mẽ và trực quan hóa dữ liệu. Kinh nghiệm với SQL và truy vấn cơ sở dữ liệu. Khả năng thu thập và diễn giải yêu cầu kinh doanh. Kỹ năng giao tiếp xuất sắc. Hiểu biết về các khái niệm lưu trữ dữ liệu (data warehousing).\r\n','Proficiency with BI tools (e.g., Power BI, Tableau).\nStrong analytical and data visualization skills.\nExperience with SQL and database querying.\nAbility to gather and interpret business requirements.\nExcellent communication skills.\nUnderstanding of data warehousing concepts.','','Power BI, Tableau','Phân tích và giải thích dữ liệu kinh doanh để cung cấp thông tin chi tiết cho việc ra quyết định.','Analyzes and interprets business data to provide insights for decision-making.',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,''),(10,'Kiến Trúc Sư/Kỹ Sư Đám Mây\n','Cloud Architect/Engineer','Kinh nghiệm với các nền tảng đám mây (ví dụ: AWS, Azure, Google Cloud). Kiến thức về kiến trúc và dịch vụ đám mây. Khả năng thiết kế các giải pháp đám mây có khả năng mở rộng và đáng tin cậy. Kỹ năng giải quyết vấn đề mạnh mẽ và tự động hóa. Quen thuộc với các thực hành DevOps. Các chứng chỉ đám mây (ví dụ: AWS Certified Solutions Architect) mang lại lợi thế.\n','Experience with cloud platforms (e.g., AWS, Azure, Google Cloud).\nKnowledge of cloud architecture and services.\nAbility to design scalable and reliable cloud solutions.\nStrong problem-solving and automation skills.\nFamiliarity with DevOps practices.\nCloud certifications (e.g., AWS Certified Solutions Architect) are beneficial.',NULL,'AWS, Azure, Google Cloud','Thiết kế và triển khai các giải pháp cơ sở hạ tầng đám mây cho các tổ chức.','Designs and implements cloud infrastructure solutions for organizations.','2024-04-03 21:45:07','2024-04-03 21:45:07',_binary '\0',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(11,'Kỹ Sư DevOps\n','DevOps Engineer','Thành thạo với các công cụ CI/CD (ví dụ: Jenkins, GitLab). Kinh nghiệm với các công cụ quản lý cấu hình (ví dụ: Ansible, Puppet). Hiểu biết sâu về các nền tảng và dịch vụ đám mây. Khả năng tự động hóa và tối ưu hóa hoạt động và quy trình. Kiến thức về các ngôn ngữ script (ví dụ: Python, Bash). Quen thuộc với các công cụ giám sát và ghi nhật ký.\n','Proficiency with CI/CD tools (e.g., Jenkins, GitLab).\nExperience with configuration management tools (e.g., Ansible, Puppet).\nStrong understanding of cloud platforms and services.\nAbility to automate and streamline operations and processes.\nKnowledge of scripting languages (e.g., Python, Bash).\nFamiliarity with monitoring and logging tools.',NULL,'Power BI, Tableau','Tích hợp hoạt động phát triển và vận hành để cải thiện sự cộng tác và năng suất trong vòng đời phát triển phần mềm.','Integrates development and operations to improve collaboration and productivity in the software development lifecycle.','2024-04-03 21:45:07','2024-04-03 21:45:07',_binary '\0',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(12,'Kiểm Thử Chất Lượng (QA)\n','Quality Assurance (QA) Tester','Kinh nghiệm với các phương pháp kiểm thử (ví dụ: thủ công, tự động). Thành thạo với các công cụ kiểm thử (ví dụ: Selenium, JIRA). Kỹ năng phân tích mạnh mẽ và giải quyết vấn đề. Khả năng viết và thực thi kế hoạch kiểm thử và các ca kiểm thử. Hiểu biết về chu trình phát triển phần mềm (SDLC) và quy trình Agile. Tỉ mỉ và có kỹ năng giao tiếp mạnh mẽ.\n','Experience with testing methodologies (e.g., manual, automated).\nProficiency with testing tools (e.g., Selenium, JIRA).\nStrong analytical and problem-solving skills.\nAbility to write and execute test plans and test cases.\nUnderstanding of SDLC and Agile processes.\nAttention to detail and strong communication skills.',NULL,'Selenium, Postman','Đảm bảo chất lượng của phần mềm bằng cách kiểm tra và xác định lỗi hoặc sự cố.','Ensures the quality of software by testing and identifying bugs or issues.','2024-04-03 21:45:07','2024-04-03 21:45:07',_binary '\0',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(13,'Chuyên Viên Hỗ Trợ Kỹ Thuật\n','Technical Support Specialist','Kỹ năng sửa lỗi và giải quyết vấn đề mạnh mẽ. Kỹ năng giao tiếp và dịch vụ khách hàng xuất sắc. Thành thạo với phần mềm trợ giúp và các công cụ hỗ trợ từ xa. Kiến thức về các hệ thống phần cứng và phần mềm. Khả năng lập tài liệu về vấn đề và giải pháp một cách rõ ràng. Quen thuộc với các khái niệm về hệ điều hành và mạng máy tính.\n','Strong troubleshooting and problem-solving skills.\nExcellent communication and customer service skills.\nProficiency with help desk software and remote support tools.\nKnowledge of hardware and software systems.\nAbility to document issues and solutions clearly.\nFamiliarity with operating systems and networking concepts.',NULL,'Jenkins, Gitlab, Ansible, Puppet','Cung cấp hỗ trợ và khắc phục sự cố về phần cứng, phần mềm và các vấn đề khác liên quan đến CNTT.','Provides assistance and troubleshooting for hardware, software, and other IT-related issues.','2024-04-03 21:45:07','2024-04-03 21:45:07',_binary '\0',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(14,'Nhà Khoa Học Dữ Liệu\n','Data Scientist','Thành thạo 1 vài ngôn ngữ lập trình (ví dụ: Python, R). Kinh nghiệm với các công cụ phân tích và trực quan hóa dữ liệu (ví dụ: Pandas, Matplotlib). Kỹ năng thống kê và toán học mạnh mẽ. Khả năng xây dựng và triển khai các mô hình học máy. Kiến thức về các nền tảng dữ liệu lớn (ví dụ: Hadoop, Spark). Kỹ năng giải quyết vấn đề và giao tiếp xuất sắc.\n','Proficiency in programming languages (e.g., Python, R).\nExperience with data analysis and visualization tools (e.g., Pandas, Matplotlib).\nStrong statistical and mathematical skills.\nAbility to build and deploy machine learning models.\nKnowledge of big data platforms (e.g., Hadoop, Spark).\nExcellent problem-solving and communication skills.',NULL,'Python, Pandas, Matplotlib, Hadoop, Spark','Phân tích và giải thích các tập dữ liệu phức tạp để cung cấp thông tin cho việc ra quyết định kinh doanh.','Analyzes and interprets complex data sets to inform business decision-making.','2024-04-03 21:45:07','2024-04-03 21:45:07',_binary '\0',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(15,'Tư Vấn Viên CNTT\n','IT Consultant','Kỹ năng phân tích mạnh mẽ và giải quyết vấn đề tốt. Kỹ năng giao tiếp và giao tiếp giữa cá nhân xuất sắc. Thành thạo với các hệ thống và phần mềm IT đa dạng. Khả năng hiểu và điều chỉnh với các mục tiêu kinh doanh. Kinh nghiệm với quản lý dự án và triển khai. Tính linh hoạt và sự thích nghi với các môi trường khác nhau.\n','Strong analytical and problem-solving skills.\nExcellent communication and interpersonal skills.\nProficiency with various IT systems and software.\nAbility to understand and align with business objectives.\nExperience with project management and implementation.\nFlexibility and adaptability to different environments.',NULL,'Commnunication, Troubleshooting, Problem-solving','Cung cấp kiến ​​thức chuyên môn và lời khuyên cho các tổ chức về cách sử dụng CNTT để đáp ứng các mục tiêu kinh doanh của họ.','Offers expertise and advice to organizations on how to use IT to meet their business objectives.','2024-04-03 21:45:07','2024-04-03 21:45:07',_binary '\0',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(16,'Giảng Viên CNTT\n','IT Trainer','Kiến thức vững về các khái niệm và công nghệ IT. Kỹ năng giao tiếp và thuyết trình xuất sắc. Kinh nghiệm với các phương pháp đào tạo và thiết kế hướng dẫn. Khả năng tạo tài liệu đào tạo và tài liệu hướng dẫn. Kiên nhẫn và khả năng giải thích những chủ đề phức tạp một cách rõ ràng. Quen thuộc với các nền tảng và công cụ học trực tuyến.\n','Strong knowledge of IT concepts and technologies.\nExcellent communication and presentation skills.\nExperience with training methods and instructional design.\nAbility to create training materials and documentation.\nPatience and ability to explain complex topics clearly.\nFamiliarity with e-learning platforms and tools.',NULL,'Python, Pandas, Matplotlib, Hadoop, Spark','Giáo dục và đào tạo các cá nhân hoặc nhóm về hệ thống, ứng dụng hoặc quy trình CNTT.','Educates and trains individuals or groups on IT systems, applications, or processes.','2024-04-03 21:45:07','2024-04-03 21:45:07',_binary '\0',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(17,'Nhà Phát Triển Ứng Dụng Di Động\n','Mobile App Developer','Thành thạo các ngôn ngữ phát triển di động (ví dụ: Swift, Kotlin). Kinh nghiệm với các framework di động (ví dụ: React Native, Flutter). Hiểu biết sâu về nguyên lý thiết kế giao diện người dùng và trải nghiệm người dùng trên di động. Khả năng tối ưu hóa hiệu suất và bảo mật ứng dụng. Quen thuộc với việc nộp và các hướng dẫn của cửa hàng ứng dụng. Kỹ năng giải quyết vấn đề và chú ý đến chi tiết.\n','Proficiency with mobile development languages (e.g., Swift, Kotlin).\nExperience with mobile frameworks (e.g., React Native, Flutter).\nStrong understanding of mobile UI/UX design principles.\nAbility to optimize app performance and security.\nFamiliarity with app store submission and guidelines.\nProblem-solving skills and attention to detail.',NULL,'Swift, Kotlin, React Native, Flutter','Thiết kế và phát triển ứng dụng cho thiết bị di động.','Designs and develops applications for mobile devices.','2024-04-03 21:45:07','2024-04-03 21:45:07',_binary '\0',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(18,'Chuyên Viên Phân Tích An Ninh Mạng\n','Cybersecurity Analyst','Kiến thức về các công cụ và thực hành bảo mật (ví dụ: tường lửa, phần mềm diệt virus). Kinh nghiệm trong phản ứng sự cố và phân tích mối đe dọa. Kỹ năng phân tích và giải quyết vấn đề mạnh mẽ. Quen thuộc với các tiêu chuẩn tuân thủ (ví dụ: ISO 27001, NIST). Khả năng phát triển và triển khai chính sách bảo mật. Các chứng chỉ như CISSP, CEH, hoặc CISM mang lại lợi thế.\n','Knowledge of security tools and practices (e.g., firewalls, antivirus).\nExperience with incident response and threat analysis.\nStrong analytical and problem-solving skills.\nFamiliarity with compliance standards (e.g., ISO 27001, NIST).\nAbility to develop and implement security policies.\nCertifications like CISSP, CEH, or CISM are beneficial.',NULL,'IT concepts and technologies, Presentation skills','Bảo vệ hệ thống máy tính và mạng khỏi các mối đe dọa và tấn công mạng.','Protects computer systems and networks from cyber threats and attacks.','2024-04-03 21:45:07','2024-04-03 21:45:07',_binary '\0',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(19,'Kỹ Sư AI/Học Máy\n','AI/Machine Learning Engineer','Thành thạo các ngôn ngữ lập trình (ví dụ: Python, Java). Kinh nghiệm với các framework học máy (ví dụ: TensorFlow, PyTorch). Hiểu biết sâu về thuật toán và cấu trúc dữ liệu. Khả năng tiền xử lý và phân tích dữ liệu. Kiến thức về các dịch vụ đám mây cho AI/ML (ví dụ: AWS SageMaker, Google AI). Kỹ năng giải quyết vấn đề và khả năng làm việc trong nhóm.\n','Proficiency with programming languages (e.g., Python, Java).\nExperience with machine learning frameworks (e.g., TensorFlow, PyTorch).\nStrong understanding of algorithms and data structures.\nAbility to preprocess and analyze data.\nKnowledge of cloud services for AI/ML (e.g., AWS SageMaker, Google AI).\nProblem-solving skills and ability to work in a team.',NULL,'Python, Java, AI','Phát triển và triển khai các giải pháp trí tuệ nhân tạo và học máy.','Develops and implements artificial intelligence and machine learning solutions.','2024-04-03 21:45:07','2024-04-03 21:45:07',_binary '\0',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(20,'Thiết Kế Giao Diện Người Dùng (UI/UX)\n','UI/UX Designer','Hiểu biết sâu rộng về nguyên lý thiết kế tập trung người dùng. Thành thạo với các công cụ thiết kế (ví dụ: Sketch, Adobe XD, Figma). Khả năng tạo ra bản vẽ mẫu, nguyên mẫu và quy trình người dùng. Kinh nghiệm với kiểm thử khả năng sử dụng và nghiên cứu người dùng. Kỹ năng giao tiếp và cộng tác xuất sắc. Chú ý đến chi tiết và kỹ năng giải quyết vấn đề sáng tạo.\n','Strong understanding of user-centered design principles.\nProficiency with design tools (e.g., Sketch, Adobe XD, Figma).\nAbility to create wireframes, prototypes, and user flows.\nExperience with usability testing and user research.\nExcellent communication and collaboration skills.\nAttention to detail and creative problem-solving skills.',NULL,'UX/UI, Figma','Tập trung vào việc tạo ra các giao diện và trải nghiệm người dùng trực quan và thẩm mỹ.','Focuses on creating intuitive and aesthetically pleasing user interfaces and experiences.','2024-04-03 21:45:07','2024-04-03 21:45:07',_binary '\0',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL);
